const initialState = {
   start:new Date(),
   end:new Date()
}

export default function(state=initialState, action) {
    switch(action.types){
        case GET_ERRORS:
            return {
                start: action.payload.start,
                end: action.payload.end,
            };
        default:
            return state;
    }
}
